import { useParams } from "react-router-dom";
export default function Detail(card) {
    const { id } = useParams();
    return (
        <div style={{
            position: 'relative',
        }}>
            <h1>SOY DETAIL ID: {id}</h1>
            <div style={{
                left: '50%',
                backgroundColor: 'blue',
                position: 'absolute',
                width:'30em',
                height: '30em',
                transform: 'translate(-50%, -10%)'
            }}>
                <div>
                    <img src={card.img} alt="" />
                </div>
            </div>
        </div>
    );
};
